{% extends \"layout/base.html.twig\" %}

{% block content %}

    <div class=\"container col-lg-12\">
        {% if is_granted(\"IS_AUTHENTICATED_REMEMBERED\") %}
            {{ 'layout.logged_in_as'|trans({'%username%': app.user.username}, 'FOSUserBundle') }} |
            <a href=\"{{ path('fos_user_security_logout') }}\">
                {{ 'layout.logout'|trans({}, 'FOSUserBundle') }}
            </a>
        {% else %}
            <a href=\"{{ path('fos_user_security_login') }}\"class=\"d-none\" >{{ 'layout.login'|trans({}, 'FOSUserBundle') }}</a>
        {% endif %}
    </div>

    {% if app.request.hasPreviousSession %}
        {% for type, messages in app.session.flashbag.all() %}
            {% for message in messages %}
                <div class=\"flash-{{ type }}\" style=\"margin-top:150px;\">
                    {{ message }}
                </div>
            {% endfor %}
        {% endfor %}
    {% endif %}
    
    {% block fos_user_content %}
        {{ include('@FOSUser/Security/login_content.html.twig') }}
    {% endblock fos_user_content %}
{% endblock  %}
    
", "@FOSUser/Security/login.html.twig", "C:\\wamp\\www\\mef-assodoves\\app\\Resources\\FOSUserBundle\\views\\Security\\login.html.twig");
